import React , {Component} from 'react'
import {PATH_BASE, PATH_MOVIE, API_KEY, DEFAULT_PAGE, PATH_PAGE} from '../api/index'

import List from './List'
import Button from './Button'
import Spinner from './Spinner'

class MainPage extends Component {

  _isMounted = false 

  state = {
    movies    : {},
    isLoading : true
  }

  componentDidMount=()=>{
    this._isMounted = true
    this.props.currentPath(window.location.pathname)
    this.getMovies(this.props.section, DEFAULT_PAGE)
  }
  
  getMovies = (section, page) => {
    fetch(`${PATH_BASE}${PATH_MOVIE}${section}?language=en-US&api_key=${API_KEY}&${PATH_PAGE}${page}`)
    .then(res => this._isMounted && res.json())
    .then(movies => this.setMovies(movies))
  }

  setMovies = (movies) => {
    const {results, page} = movies

    const olderResults = page !==1 ? this.state.movies.results : []

    const newerResults = [
      ...olderResults,
      ...results
    ]

    this.setState({
      movies    : { results: newerResults, page},
      isLoading : false
    })
  }

  componentWillUnmount = () => {
    this._isMounted = false
  }

  //it doesnt work
  // componentWillUnmount = (state, callback) => {
  //   return
  // }

    render(){
      const {movies} = this.state
      const {results, page} = movies

        return ( <>
          { this.state.isLoading && 
            <Spinner />
          }
          <div className='container'>

            <h1 style={{color:'#fff', display:'table', marginRight:'auto', marginBottom:'7px'}} >{this.props.title}</h1>


            {results &&
            <>
            <List list = {results} 
                  addToFavorite  = {this.props.addToFavorite}
                  removeFromFavorite = {this.props.removeFromFavorite}
                  isAuthenticated= {this.props.isAuthenticated}
                  favoriteMovies = {this.props.favoriteMovies}
            />

            <Button className='Button' 
                    text='Load More'
                    onClick={()=>this.getMovies(this.props.section, page+1)}
                    />
            </>
            }

          </div>
          </>
        )
    }
}

export default MainPage


